import * as React from 'react';
import { Text, View, StyleSheet, TextInput, Button, TouchableOpacity, NavigatingContainer, ImageBackground } from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Header } from "react-native-elements";
import { SearchBar } from "react-native-elements";
import { Image } from "react-native";
import { Card, ListItem,  Icon } from "react-native-elements";
import { getDownloadURL, getStorage } from "firebase/storage";
import { ref as refS } from "firebase/storage";

// import { createNativeStackNavigator } from "@react-navigation/native-stack";

// const Stack = createNativeStackNavigator();

export default function FLATLIST({ navigation })  {
      const [url, setUrl] = React.useState();
      var cou = 0
      const didMount = React.useRef(false);

      var flatListData = [{

"key":
"598a678278fee204ee51cd2c",
"name": "Cream Tea",
"imageUrl": () => {React.useEffect(() => {
        const func = async () => {
          const storage = getStorage();
          const reference = refS(storage, "/image_sample.png");
          await getDownloadURL(reference).then((x) => {
            setUrl(x);
          });
          return x


        };
        func();
      }, [])},
"foodDescription": "This is a cup of cream tea"
 }]



      console.log(url, (cou++))






     const [search, updateSearch] = React.useState();
      console.log(search)



    const getData = async () => {
        try {
          const value = await AsyncStorage.getItem('test')
          if(value !== null) {
            console.log('value from home: ', value);
          }
        } catch(e) {
          // error reading value
        }
      }
      getData()






      React.useEffect(() => {
        if (!didMount.current) {

          didMount.current = true;
          return;

        }

        if (url == undefined) {
          console.log(url, "!URL 1");
          document.title = "Threshold of over 1 reached.";
        } else {
          console.log(url, "!URL 3");
          global.users = [
            {
              name: "brynn",
              avatar: url,
            },

          ];


          document.title = "No threshold reached.";
        }
      }, [url]);

    return (
      <View style={styles.container}>
        <Header
          elevated={true}
          // containerStyle={styles.container}
          leftComponent={<Text style={styles.paragraph}>ClothShare</Text>}
          centerComponent={
            <SearchBar
              round={true}
              clearIcon={true}
              lightTheme={true}
              placeholderTextColor={"black"}
              containerStyle={styles.containerSearch}
              inputContainerStyle={styles.containerSearch2}
              inputStyle={{ color: "black" }}
              placeholder="Type Here..."
              onChangeText={updateSearch}
              value={search}
            />
          }
          rightComponent={{ icon: "home", color: "#fff" }}
        />

        <View>

          style=
          {{
            flex: 1,
            flexDirection: "column",
          }}
          >
          <View
            style={{
              flex: 1,
              flexDirection: "row",
              // backgroundColor: this.props.index % 2 == 0 ? 'mediumseagreen':

              backgroundColor: "mediumseagreen",
            }}
          >
            <Image>
              source={{ uri: url }}
              style={{ width: 100, height: 100, margin: 5 }}
            </Image>

            <View
              style={{
                flex: 1,
                flexDirection: "column",
                height: 100,
              }}
            >
              <Text style={styles.flatListItem}>{this.props.item.name}</Text>
              <Text style={styles.flatListItem}>
                {this.props.item.foodDescription}
              </Text>
            </View>
          </View>
        </View>
      </View>
    );

}




const styles = StyleSheet.create({
  container: {
    justifyContent: "top",
    alignSelf: "top",
  },
  containerCard: {
    width: "98%",
    height: "100%",
    padding: 0,
    borderWidth: 1,

  },
  containerCardMaster: {
    paddingLeft: "20%",
